import * as React from 'react';
import { StyleSheet, Image,Text, View, Button, TouchableOpacity, ImageBackground } from 'react-native';
import {Icon} from 'react-native-elements';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import About from "./components/About";
import MyLearning from "./components/MyLearning"
import Resources from "./components/Resources";
import MyLearningForm from "./components/forms/MyLearningForm";




// import { createBottomTabNavigator, createAppContainer } from 'react-navigation';
// import Icon from "react-native-vector-icons/FontAwesome";


function HomeScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center', padding:'200'}}>
      <TouchableOpacity style = {styles.button}>
      <Button
        title="About"
        color="black"
        onPress={() => {navigation.navigate("About")}}
      />
      <Button
        title="MyLearning"
        color="#330066"
        onPress={() => {navigation.navigate("MyLearning")}}
      />


      <Button
        title="Resources"
        color="black"
        onPress={() => {navigation.navigate("Resources")}}
      />
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  text: {
    fontSize: 60,
    textAlign: 'center',
  },
  button: {
    height: 200,
    width: 800,
  },
  image:{
    flex: 1,
    height: 70,
    width: 800 ,

  },  backButton: {
    height: 44,
    width: 44,
    justifyContent: 'center',
    alignItems: 'center',
  },
});


const Stack = createStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={HomeScreen} />
        <Stack.Screen name="About" component={About} />
        <Stack.Screen name="Resources" component={Resources}/>
        <Stack.Screen name="MyLearning" component={MyLearning}/>
        <Stack.Screen name="MyLearningForm" component={MyLearningForm}/>


      </Stack.Navigator>
    </NavigationContainer>
  );
}
